import React, { useEffect } from "react";

// importar cliente axios
//import usuarioAxios from '../../config/axios';

function Usuarios(){

    // Query app
    const consultarAPI = ()=> {
        console.log('Consultando..');
    }
    // use efect es simillar a component
    useEffect( ()=> {
        consultarAPI();
    });

    return (
        <h2>Usuario</h2>
    )
}
export default Usuarios;
